INSERT INTO `blogs` (`id`, `title`, `category_id`, `image`, `description`, `short_description`, `active`, `hit_count`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(4, 'Yoga is for Mad People', '4', 'images/fH1mNt0ddmxIb6jVEC22e7iubZA9i3zAxKzURNFL.jpg', '<p style=\"text-align: left;\"><span id=\"docs-internal-guid-0b984d57-7fff-3d5e-55c1-dd586ddc0345\"><b><span style=\"font-size: 11.5pt; font-family: Arial; color: rgb(14, 16, 26); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Y</span><span style=\"font-size: 11.5pt; font-family: Arial; color: rgb(14, 16, 26); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">oga is not a cure-all but a means of creating an awareness of our condition.</span></b></span><br></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">For many, there is no substitute for the counseling and medications provided by mental health professionals, which can be a great way to aid in bringing balance into our lives. Acknowledging when we need help, and accepting it, is a necessary part of the healing process.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">There was a time in my life—not all that long ago—when I was a drunk.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">When I struggled to find a center, it was a time to find a reason to wake up and not dive headfirst into whatever I was doing to avoid the work of healthy coping skills. I\'d been leaning toward the dysfunctional side of the spectrum since I was a preteen, and, in many ways, I reveled in it.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">I avoided the practice for a long time, under the assumption that I didn\'t fit the yogi bill of clean living and a regular exercise routine. I couldn\'t practice because I was lazy, or broke, or smoked cigarettes and drank; allowing myself to find some balance in my life meant I would become dull or lose my rebellious nature.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">It wasn\'t until my life fell completely apart, and I was sitting among the wreckage, that I realized this practice of breath and movement wasn\'t only about opening hamstrings but about finding a way to move through my madness.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Yoga would become a survival tool and a method of managing and harnessing the chaos of the human experience that I had identified myself with for so long.</span></p><p style=\"text-align: left;\"><span id=\"docs-internal-guid-7a825dea-7fff-a1b4-ab42-13ae64818ffa\"></span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">So, in a tiny corner of my room, I began clumsily following along on YouTube videos in my wrecked and infested apartment. I chose to start with a bit on the workout side of yoga (also known as yang), but it was a start.\r\n\r\n</span><img src=\"data:image/jpeg;base64,\" data-filename=\"0bIIxojA.jpeg\" style=\"width: 917px;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">There are tons of </span><a href=\"https://www.youtube.com/watch?v=8WAnkCkAP5I\" style=\"text-decoration:none;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#1155cc;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:underline;-webkit-text-decoration-skip:none;text-decoration-skip-ink:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">free instructional videos </span></a><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">and led classes for all levels. Perhaps you\'d prefer to begin with simple breath guidance or a five-minute gentle movement class. All it takes is the first step and even simple movements—along with breath practice—to relieve stress and aid in bringing awareness to our bodies and thoughts.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">With so many available options, you\'re bound to find something that feels right for you. While I fully believe in the value of having an instructor to guide you personally, it\'s such a blessing to be able to show up wherever you are that day without worrying that you may be judged—even if you\'re stumbling through a messy apartment with a bedhead.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">It\'s committing to showing up for yourself, no matter how you may look or even feel, that brings about the power of passive observation of our external and internal condition. This skill can help us better cope with, understand, and even transform our reality.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Do I stray from my regular practice? We inevitably get off track. It is the act of returning to ourselves, over and over and over again, that builds resilience and allows us to practice grace and radical self-love. This kind acknowledges our imperfections and blessings without allowing them to consume us.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The goal is not to reach some point of perfect concentration but rather to consistently bring ourselves back.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">It is the nature of this human condition to spiral away from ourselves; it can help expand and keep us active in the material world. It can inspire us to be vulnerable with ourselves and connect more deeply with others\' struggles and pain. The practice is simply a means of bringing back into perspective our present condition, observing ourselves and the world around us, and finding the stillness necessary to decide the best course of action.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The continued practice of yoga has changed my life.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Taking those first steps down a path I thought I wasn\'t ready for added an element of accountability to my life in so many ways, beginning with giving me a reason to stay sober long enough to get my practice in for the day. It was a small step but a significant turning point in recognizing my ability to control how my mental, physical, and emotional health affects my behavior.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Even still, I have plenty of struggle days, but instead of running, I lean in. I feel and express in ways that are, at the very least, not destructive to myself or the people around me.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">It\'s most certainly not a guarantee of perfection, and I have made many mistakes, even after I began my yoga practice.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">I have no doubt there will be more to come. But, through all of the uncertainties of human experience, knowing I can return to this space of reflection to understand, accept, and grow, makes it all seem a little less catastrophic, and that is a significant win.</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span id=\"docs-internal-guid-a32f0fe5-7fff-7d0f-795d-b2866bf04a0c\"></span></span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Credits: </span><a href=\"https://www.elephantjournal.com/2021/02/yoga-is-for-crazy-people-who-are-moving-through-madness-emily-williams/\" style=\"text-decoration:none;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#1155cc;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:underline;-webkit-text-decoration-skip:none;text-decoration-skip-ink:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Emily Williams&nbsp;</span></a></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#0e101a;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">\r\n</span></p>', 'Yoga is not a cure-all but a means of creating an awareness of our condition. For many, there is no substitute for the counseling and medications provided by mental health professionals, which can be a great way to aid in bringing balance into our lives. Acknowledging when we need help, and accepting it, is a necessary part of the healing process.', 'on', 1, '10', '10', '2021-03-03 02:37:15', '2021-03-04 14:57:26');
INSERT INTO `blogs` (`id`, `title`, `category_id`, `image`, `description`, `short_description`, `active`, `hit_count`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(35, 'DAILY AYURVEDA IN 5 EASY STEPS!', '2', 'images/qEkJb0qQ1SpkfF9qySSNblOQfPrTOGEe61OMM9g4.jpg', '<span id=\"docs-internal-guid-e87a9576-7fff-0d93-5e3b-c376328a8cd5\"><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Ayurveda is the sister science of yoga. It is the oldest existing science of health, more than 5,000 years old. In Ayurveda it is believed that all persons are made up of the same primary elements that exist in nature – fire, water, earth, air and space. These are all present in each of us in varying quantities, and this unique make-up, called our dosha or constitution, is what accounts for our individual characteristics and differences. Ayurveda teaches us how to make choices that are ideal for our body and mind, according to our dosha.</span></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Even if you have never seen an Ayurvedic practitioner and have no idea what your constitution is, there are simple ways that you can adapt Ayurvedic lifestyle practices into your daily routine and improve your health:</span></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">1)&nbsp; &nbsp; &nbsp; Get a tongue scraper.</span></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"color: rgb(45, 45, 45); font-family: Arial; font-size: 12pt; white-space: pre-wrap;\">In Ayurveda, health is closely linked with the presence or absence of toxins in the body. Using a tongue scraper first thing in the morning, before brushing your teeth, is an excellent way to remove toxins and bacteria that accumulate in the mouth while you sleep. This will not only improve your breath and your overall oral health, but your digestion will also be more efficient. Tongue scraping enhances your sense of taste. Taste is actually the first step in the digestive process. So by enhancing taste you are supporting the entire digestive process, simply by scraping your tongue!</span><br></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">2)&nbsp; &nbsp; &nbsp; Start oil pulling.</span></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Oil pulling is the practice of using sesame or coconut oil essentially as a mouthwash, and swishing it around in your mouth for anywhere from 10-20 minutes. This is an ancient Ayurvedic ritual that has tons of benefits. This practice has been gaining more popularity in recent years as more and more people have become aware of its many health advantages. Oil pulling detoxifies the body by pulling toxins from the mouth and is excellent for the teeth and gums. It also has teeth-whitening and breath-freshening effects. When done regularly, oil pulling has a rejuvenating effect and helps to enhance the senses. Ayurveda gives a lot of importance to the tongue, which is believed to be intimately connected to different body organs. Purifying the tongue with oil therapy is thus believed to be beneficial for the whole body!</span></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">3)&nbsp; &nbsp; &nbsp; Practice self-massage with body oil.</span></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Abhyanga is a luxurious Ayurvedic ritual which involves self-massage with warm oil all over the body. It feels just as amazing and relaxing as it sounds! This wonderful practice has so many benefits, other than the obvious – well hydrated, baby-soft skin. When warm oil is absorbed into the skin it nourishes all parts of the body, enhances circulation and stimulates the lymphatic system. The act of self-massage itself is a nurturing ritual involving the sense of touch, an important healing tool in Ayurveda. Traditionally, either coconut oil or sesame oil are used, depending on your particular dosha, but any other plant-based oils can be used. The oil should be lightly heated for better absorption and is then gently massaged into the skin from head to toe, going in circular motions and always moving towards the heart. You can relax for about ten minutes afterwards to allow the oil to absorb into the skin prior to taking a bath or shower. When done prior to a bath or shower, abhyanga aids in the removal of toxins from the body. It is both purifying and invigorating!</span></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">4)&nbsp; &nbsp; &nbsp; Rise with the sun.</span></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Ayurveda encourages us to rise early – ideally, before sunrise, or before 6am. In Ayurveda it is believed that we should live our lives in rhythm with the sun’s cycles as we are deeply connected to nature. Before 6am is also when Vata, the dosha that is made up of the elements of air and space, is dominant. Vata is responsible for movement and this is a time when our energy levels are optimal and our brain is active. This would be an ideal time for spiritual practice or exercise. Performing sun salutations or other yoga asanas are a great way to start the day.</span></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 15pt 0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">5)&nbsp; &nbsp; &nbsp; Eat mindfully.</span></p><p dir=\"ltr\" style=\"line-height: 2.1; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 15pt;\"><span id=\"docs-internal-guid-5847bb60-7fff-e918-52fb-b38d0b6f0837\"></span></p><p dir=\"ltr\" style=\"line-height:2.1;background-color:#ffffff;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#2d2d2d;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Ayurveda teaches us that it is not just what we eat that is important, but how we eat, and eating with mindfulness is so vital for a balanced body and mind. Our culture and busy lifestyles may not always allow for this. We are so used to rushing from one activity to the next that oftentimes we may find ourselves eating our meals at our desks at work, or eating dinner while watching TV or answering emails. In Ayurveda food is considered sacred and should be honored and eaten with intention. Mindful eating requires us to slow down and honor the food we are putting into our body. That food will in turn bring us nourishment and pleasure. This act of slowing down is similar to the pause in between breaths, and the same intention that we practice when doing yoga. Eating is such an essential part of our lives, we should be giving it the same time and consideration that we do to other activities.</span></p></span>', 'Ayurveda is the sister science of yoga. It is the oldest existing science of health, more than 5,000 years old. In Ayurveda it is believed that all persons are made up of the same primary elements that exist in nature – fire, water, earth, air and space.', 'on', NULL, '10', '10', '2021-03-04 13:14:46', '2021-03-04 14:56:10'),
(36, 'SUN-KISSED CARE', '2', 'images/tCx4MSk9RDldUs7VOiwVhPedOF3fY8p6kqayh80E.jpg', '<span id=\"docs-internal-guid-0420544f-7fff-c877-1fc4-6d6ddd128555\"><p dir=\"ltr\" style=\"line-height: 2.1; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 15pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Extra exposure to the elements is a given when taking in the delights of summer breezes and warm weather activities. Essential oils can help with sunburn and skin damaged by to much wind and harsh elements.</span></p><p dir=\"ltr\" style=\"line-height: 2.1; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 15pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Start by using enriching carrier oils, like coconut or avocado oil, which have some natural SPF factors, while cocoa butter and aloe vera gel can sooth the heat on sun damaged skin. In addition, using certain essential oils can aid in the repair of damage from overexposed skin.</span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 15pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">• Palmarosa (Cymbopogon marini) </span><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">is used extensively in skin care due to</span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 15pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">its hydrating and antiseptic properties. It can help balance sebum</span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 15pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">production for all types of skin. Most importantly, it is presumed to</span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 15pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">stimulate cellular regeneration for damaged skin.</span></p><p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 15pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height: 2.1; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 15pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">• Carrot Seed (Daucus carota) </span><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">is recognized as one of the most revitalizing essential oils for the skin, mostly due to its nourishing and purifying effects on the liver, which manifests itself in skin quality. This cellular regenerative ability for both the skin and liver provides the ultimate nourishment for any multitude of poor skin conditions (eczema, psoriasis, rashes and wrinkles).</span></p><p dir=\"ltr\" style=\"line-height: 2.1; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 15pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">• Rock Rose (Cistus ladaniferus)</span><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> is renowned for its skin healing abilities, particularly when the skin is chronically affected with eczema or psoriasis. Its astringent and antiseptic properties are well documented and it’s highly recommended for acne and oily skin, but also aids when over exposure to sun damage.</span></p><p dir=\"ltr\" style=\"line-height: 2.1; margin-top: 0pt; margin-bottom: 15pt;\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">• Patchouli (Pogostemon patchouli) </span><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">has been used by the perfume industry for hundreds of years for its earthy exotic fragrance. But in addition to smelling lovely, it contains moisturizing properties that are healing to the skin, especially for scars and sore cracked wounds. It also has cooling effects and thus is wonderful for an after sun lotion or oil.</span></p><div><span style=\"font-size: 12pt; font-family: Arial; color: rgb(45, 45, 45); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></div></span>', 'Extra exposure to the elements is a given when taking in the delights of summer breezes and warm weather activities. Essential oils can help with sunburn and skin damaged by to much wind and harsh elements.', 'on', NULL, '10', '10', '2021-03-04 13:16:19', '2021-03-04 14:57:44'),
