INSERT INTO `blogs` (`id`, `title`, `category_id`, `image`, `description`, `short_description`, `active`, `hit_count`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(123, 'Do You Know Your \"Why?\"', '8', 'images/oFP9BO0cPqlGSggIsiZVYm9iV8O0QEI3A7sXXXD2.jpg', '<p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Let me ask you something…are you confident enough to step into the eye of the storm?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Probably not.</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Let me ask you this…why would you&nbsp;want&nbsp;to step into the eye of the storm?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Because that is where the growth is.</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Or how about this – do you know your WHY?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Maybe not.</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Or this –&nbsp;why do you practice yoga?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">To be flexible?&nbsp;To be strong?&nbsp;To help with anxiety?</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Wrong answers! These are not your WHY as to why you bring yourself to your mat or meditation cushion each day. These are the&nbsp;results&nbsp;of practicing yoga. But&nbsp;your&nbsp;WHY is something else.</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">I didn’t know too much about this until I did my teacher training and we did deep transformational work with a “touch of yoga” thrown in,&nbsp;(which in turn ended up being the transformational work without us evening knowing!)&nbsp;Mind. Blown.</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">So, here’s my WHY:</strong></p><p class=\"has-text-align-center s12 has-large-font-size\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; font-size: 1.424rem; text-align: center; line-height: 1.5; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif;\">‘To be strong and confident…on and off the mat’</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Strong and confident on my mat with my&nbsp;asanas&nbsp;(arm balances, inversions, headstands, handstands – you know, all the fun stuff but all the hard stuff!) Strong and confident off my mat in daily life and the challenges it brings (enter Covid-19 and lockdown!)</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">So, what does my WHY give me?</strong></p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">It gives me ease, strength, confidence, and guidance, but ultimately peace and happiness.&nbsp;And through peace and happiness, I have grown so much more, without that even being the intention of my WHY.</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"AdobeStock_56851044.jpg\" style=\"width: 1024px;\"><br></p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Here I’d like to share with you 3&nbsp;ways finding my WHY helped me to grow, and how finding you why, you too can grow:</p><p class=\"s4 has-medium-font-size\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; font-size: 1.125rem; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">1)&nbsp;Perseverance&nbsp;–&nbsp;on the mat</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Let me ask you this, what is your worst yoga asana?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">I have a few, ha! (You wouldn’t think I’m a yoga teacher!)</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">For me, here are a couple I find challenging:<br style=\"border-width: 0px; border-style: solid; border-color: currentcolor;\">– Half Moon<br style=\"border-width: 0px; border-style: solid; border-color: currentcolor;\">– Pincha&nbsp;forearm stand</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Because my WHY is to be strong and confident on &amp; off the mat, chanting this to myself whenever I’m faced with a challenging asana has helped wonders with my mind and mental state during a tricky yoga pose.</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Let’s break down the forearm stand, the trickier of the two. You need a whole heck of a lot of shoulder strength and core strength to hold this and keep a straight line. The body needs to be stacked with no banana-shaped back. You need to have open hamstrings in order to walk the legs in and stack the hips in order to come up into the forearm stand with control, without kicking up.</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">This is my nemesis. But with these&nbsp;physical challenges come the mental challenge and perseverance on the mat. ‘To be strong &amp; confident on &amp; off the mat’ – strong in my shoulders and core, strong in my mind (‘I’ve got this, I can totally do this!’), confidence in not falling over and if I do, so what? You learn from every fall and it builds you up to grow.</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">So, what’s your challenging yoga pose(s)?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Have you thought about your WHY to help you with these poses?</strong></p><p class=\"s4 has-medium-font-size\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; font-size: 1.125rem; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">2)&nbsp;Can do attitude&nbsp;–&nbsp;off the mat</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">In life what are your biggest challenges?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Is it raising&nbsp;3 kids all under the age of 6?</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Or perhaps, juggling work and the kids?</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Or maybe your dream is to start your own business but you’re worried you are not enough?</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">For me, it was the latter. I used to do the whole 9-5&nbsp;thing, but I was lucky, I loved my job (I designed shoes, and still do part-time.) But I always had a feeling that there was more to life.&nbsp;More to me.&nbsp;More to what I can offer the world and what I wanted to be a part of and create.&nbsp;Finding and connecting to my WHY has 100% given me the belief in myself that I CAN DO THIS. It’s not there all day every day. But when those negative thoughts creep in (which they will do, we’re only human!) I&nbsp;chant back to myself in my mind my WHY, and faith is restored&nbsp;again&nbsp;in myself.</p><p class=\"s4 has-medium-font-size\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; font-size: 1.125rem; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">3)&nbsp;Eye of the&nbsp;storm – life’s biggest challenges</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">For me, it was when I was 37. My world stopped.</strong></p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Dealing with grief is such a personal&nbsp;thing,&nbsp;it’s different for everyone. I’ve said goodbye to long-lost family members before as I was growing up. But this was different. This was my mum.&nbsp;My most amazing mum.&nbsp;We lost my mum suddenly to cancer, and my world hasn’t been the same since.</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">This isn’t a post about grief – or how to deal with it.</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">But more so, a blog post about how – even in the most challenging, sickening, confusing, upsetting, heart-wrenching times,&nbsp;in the eye of the storm, we can get through to the sunshine. Or at least, get through to a mild day with blue sky and no more&nbsp;storm.</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">See, life isn’t joyous 100% of the time. Yoga teaches us not to observe life through rose-tinted glasses, yet so often we do.</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">When life decides to turn your world upside down and rip away from your mum, how do you cope? Sure, loved ones, friends &amp; family are always there for you. But my WHY helped me on a much deeper personal level. I don’t talk about it with anyone. I haven’t really shared it with my family. It’s for me and me only.</p><p class=\"s4 has-medium-font-size\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; font-size: 1.125rem; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Summary:</strong></p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">So, what does my WHY give me? It gives me ease, strength, confidence, and&nbsp;guidance, but ultimately peace and happiness.&nbsp;</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">I urge you to find your WHY. And if you don’t know what it is – that’s fine. Explore it, dance around it, then connect and nurture&nbsp;it through your yoga practice, through your meditation practice.</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Connect to your breath and let your breath guide you. Let the breath connect you–mind and body, body and soul. Let your breath connect your conscious and sub-conscious. Here we will explore and find our WHY.</p>', 'So, what does my WHY give me? It gives me ease, strength, confidence and guidance, but ultimately peace and happiness. \r\n\r\nI urge you to find your WHY. And if you don’t know what it is – that’s fine. Explore it, dance around it, then connect and nurture it through your yoga practice, through your meditation practice.', 'on', NULL, '10', '10', '2021-04-01 09:55:26', '2021-04-01 09:58:21');
INSERT INTO `blogs` (`id`, `title`, `category_id`, `image`, `description`, `short_description`, `active`, `hit_count`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(124, 'Do You Know Your \"Why?\" 4 Questions To Find Your Purpose', '4', NULL, '<p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Let me ask you something…are you confident enough to step into the eye of the storm?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Probably not.</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Let me ask you this…why would you&nbsp;want&nbsp;to step into the eye of the storm?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Because that is where the growth is.</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Or how about this – do you know your WHY?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Maybe not.</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">Or this –&nbsp;why do you practice yoga?</strong></p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">To be flexible?&nbsp;To be strong?&nbsp;To help with anxiety?</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Wrong answers! These are not your WHY as to why you bring yourself to your mat or meditation cushion each day. These are the&nbsp;results&nbsp;of practicing yoga. But&nbsp;your&nbsp;WHY is something else.</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">I didn’t know too much about this until I did my teacher training and we did deep transformational work with a “touch of yoga” thrown in,&nbsp;(which in turn ended up being the transformational work without us evening knowing!)&nbsp;Mind. Blown.</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">So, here’s my WHY:</strong></p><p class=\"has-text-align-center s12 has-large-font-size\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; font-size: 1.424rem; text-align: center; line-height: 1.5; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif;\">‘To be strong and confident…on and off the mat’</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">Strong and confident on my mat with my&nbsp;asanas&nbsp;(arm balances, inversions, headstands, handstands – you know, all the fun stuff but all the hard stuff!) Strong and confident off my mat in daily life and the challenges it brings (enter Covid-19 and lockdown!)</p><p class=\"s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><strong style=\"border-width: 0px; border-style: solid; border-color: currentcolor; font-weight: bold;\">So, what does my WHY give me?</strong></p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\">It gives me ease, strength, confidence, and guidance, but ultimately peace and happiness.&nbsp;And through peace and happiness, I have grown so much more, without that even being the intention of my WHY.</p><p class=\"has-text-align-justify s4\" style=\"border-width: 0px; border-style: solid; border-color: currentcolor; margin-right: 0px; margin-bottom: 2rem; margin-left: 0px; text-align: justify; color: rgb(90, 91, 92); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18.2px;\"><img src=\"data:image/jpeg;base64,', NULL, NULL, NULL, '10', '', '2021-04-01 10:14:40', '2021-04-01 10:14:40');
