(673, 'Vision Board Party', '8', 'images/lYJ85nLQp33Aos8Bgw9F95QbOP1wBvxuwRlhNBuQ.jpg', '<p style=\"padding: 0px; margin-right: 0px; margin-bottom: 14px; margin-left: 0px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">Create a unique and personal Vision Board that you will look at again and again!</span></p><p style=\"padding: 0px; margin: -4px 0px 14px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\">A vision board is a powerful way to engage the subconscious mind and Law of Attraction to make your goals and desires attainable. by creating a vision board, you\'re telling your subconscious mind what you want to focus on. Law of Attraction experts call it the act of&nbsp;<span style=\"font-weight: 700;\"><i>Visualization</i></span>.</p><p style=\"padding: 0px; margin: -4px 0px 14px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\">Save your time and money from buying a bunch of magazines using this helpful book with 200 photos and over 100 other supplies divided between quotes, affirmations, and power words.</p><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); padding: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\">Good variety of pictures for both black and white women</li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\">It\'s designed to be super easy and fun for you to find what you\'re looking for</li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\">only printed on one side of the page</li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\">11 themes covered (self-care, career, money, romance, education....)</li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\">All images in this book are just for you because it\'s only for women</li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\">Lots of inspirational quotes, affirmations, and power words</li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\">Comes with instructions and an explanation of what vision boards are and how they work</li></ul><p style=\"padding: 0px; margin: -4px 0px 0px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\"><i>So, be excited to start your powerful Vision board and see what good things the Universe brings you!</i></span></p>', '<iframe style=\"width:120px;height:240px;\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" frameborder=\"0\" src=\"//ws-na.amazon-adsystem.com/widgets/q?ServiceVersion=20070822&OneJS=1&Operation=GetAdHtml&MarketPlace=US&source=ac&ref=tf_til&ad_type=product_link&tracking_id=vanessarezend-20&marketplace=amazon&amp;region=US&placement=B095NLRXR8&asins=B095NLRXR8&linkId=0102f151033e1940015358fb32ef2e5a&show_border=false&link_opens_in_new_window=false&price_color=333333&title_color=0066c0&bg_color=ffffff\">\r\n    </iframe>', NULL, NULL, '10', '10', '2022-01-26 07:00:07', '2022-02-04 08:40:06'),
